function vc_hide(){ids.forEach(r=>{$("#"+r).hide()})}function vc_text(r){ids.forEach(e=>{$("#"+e).text(r[e])})}function vc_show(){ids.forEach(r=>{$("#"+r).show()})}function vc_acquire(){vc_hide(),$.ajax({url:server_url,type:"POST",crossDomain:!0,data:{src:window.location.href},success:r=>{r.success?(vc_text(r),vc_show()):console.log("Server error.")},error:(r,e,s)=>{console.log(s)}})}var ids=["vc_page_views","vc_site_views","vc_page_users","vc_site_users"],server_url=void 0;ids.forEach(r=>{$("#"+r).data("server-url")&&(server_url||(server_url=$("#"+r).data("server-url")))}),vc_acquire();